    {
        MUSIC_TRACK,
        SOUND,
        SOUND_CUE
    }

    public struct Graphic
    {
        public EGraphicType Type;
        public string Bundle;
        public string Name;
        public int ID;
        public int Frame;
        public string FrameKey;
        public float Width;
        public float Height;
    }

    public struct Sound
    {
        public ESoundType Type;
        public string Bundle;
        public string Name;
        public string SoundLabel;
    }

