        public static IEnumerable<EBundle> AllBundles => Enum.GetValues(typeof(EBundle)).Cast<EBundle>();

        public static string ToName(this EBundle bundle)
        {
            return BundleNames[(int)bundle];
        }

        public static EBundle FromName(string bundleName)
        {
            return (EBundle)Array.IndexOf(BundleNames, bundleName);
        }

        public static EBundle FromTheme(ETheme theme)
        {
            return (EBundle)theme;
        }

